import Logo from "../components/Logo";

var style = {
  position: "relative",
  bottom: "0",
  width: "100%",
  height: "6rem" /* Set the fixed height of the footer here */,
  lineHeight: "60px" /* Vertically center the text there */,
  backgroundColor: "#fbfbfb",
};

const Footer = () => (
  <footer style={style}>
    <div class="container">
      <div class="row">
        <div class="col-sm"><p>Generisk Bank AS</p><p>Gatevegen 42, 5007 Bergen</p><p>Orgnnr: 999 999 999</p></div>
        <div class="col-sm"><Logo/></div>
        <div class="col-sm">One of three columns</div>
      </div>
    </div>
  </footer>
);

export default Footer;
